import React from 'react';
import { Layout, Menu } from 'antd';
import { UserOutlined, VideoCameraOutlined, FileSearchOutlined } from '@ant-design/icons';
import './SideNav.css';

const { Header } = Layout;

const NavBar = ({ selectedKey, onMenuClick }) => (
  <Header style={{
    background: 'rgba(34, 40, 49, 0.85)',
    borderRadius: '0 0 24px 24px',
    boxShadow: '0 2px 16px rgba(0,0,0,0.12)',
    margin: '0 0 32px 0',
    width: '100%',
    zIndex: 100,
    display: 'flex',
    alignItems: 'center',
    padding: '0 48px'
  }}>
    <div style={{ flex: 1, fontWeight: 'bold', fontSize: 24, color: '#fff', letterSpacing: 2 }}>
      河流漂浮物检测系统
    </div>
    <Menu
      mode="horizontal"
      theme="dark"
      selectedKeys={[selectedKey]}
      style={{
        background: 'transparent',
        border: 'none',
        minWidth: 400,
        display: 'flex',
        justifyContent: 'flex-end'
      }}
      onClick={onMenuClick}
    >
      <Menu.Item key="/upload" icon={<VideoCameraOutlined />}>视频上传</Menu.Item>
      <Menu.Item key="/results" icon={<FileSearchOutlined />}>检测结果</Menu.Item>
      <Menu.Item key="/logs" icon={<UserOutlined />}>日志管理</Menu.Item>
      {/* 其它菜单 */}
    </Menu>
  </Header>
);

export default NavBar;
